import './App.css';

import { Partners } from './Components/Partners';
import {BrouserRouter} from 'react-router-dom'

function App() {
  return (
    <BrouserRouter>
      <div className="App">
        <Partners/>
      </div>
    </BrouserRouter>
  );
}

export default App;
